export const HeaderContainer = styled.div`
display: flex;
justify-content: space-between;
align-items: center;
padding: 0 15%;
margin: 4rem 0;
`

export const Title = styled.p`
margin: 0;
text-align: center;
font-size: 2.5rem;
font-weight: bold;
`

export const CardContainer  =styled.div`
display: flex;
justify-content: center;
align-items: center;
gap: 4rem;
padding: 0 1%;
flex-wrap: wrap;


`
